import 'bootstrap/dist/css/bootstrap.min.css';
import { Jumbotron } from 'reactstrap';

function HomePage() {
    return (
        <div>
            <Jumbotron>
                <h1 className="text">Welcome to Site!</h1>
            </Jumbotron>
        </div>
    )
}

export default HomePage
